    }

    return (
        <div className="event">
            <div className="item">
                <h3> {eve.text} </h3>
                <button>Show More</button>
            </div>
            <RiDeleteBin2Fill className="delete-btn" onClick={onDelete} />
        </div>
    )
}

export default Event
